@router.get("/", response_model=List[SdToImg])
async def read_img_list(request: Request, skip: int = 0, limit: int = 30, db: Session = Depends(get_db)):
    img_list = get_img_list(db, skip=skip, limit=limit)
    # return items
    new_img_list = []
    for img in img_list:
        content = str(img.content).replace("b'", "").replace("'", "")
        if img.content == None or content == "":
            content = f"R0lGODlhAQABAIAAAAAAAP///yH5BAEAAAAALAAAAAABAAEAAAIBRAA7"
        content_new = str(img.content_new).replace("b'", "").replace("'", "")
        if img.content_new == None or content_new == "":
            content_new = f"R0lGODlhAQABAIAAAAAAAP///yH5BAEAAAAALAAAAAABAAEAAAIBRAA7"
        # print(old_content)
        img.content = content
        img.content_new = content_new
        new_img_list.append(img)

    return templates.TemplateResponse("view/stables/stables.html",{"request": request, "img_list": new_img_list})


