@router.post("/create", response_model=SdToImg)
async def create_img(
    request: Request,
    prompt: str = Form(...),
    image_file: UploadFile = Form(...),
    steps: str = Form(...),
    ai_level: str = Form(...),
    cn_mode: str = Form(...),
    db: Session = Depends(get_db)
):
    create_by = request.cookies.get("login")
    # print(prompt, steps, ai_level, cn_mode)
    # new_task = create_task(prompt)
    # uid = jsonResponse_to_json(new_task)['uid']
    content = await image_file.read()
    image = base64.b64encode(content)
    # image_str = image.decode('utf-8')
    # image_str_encode = image_str.encode('utf-8')
    # print(image, "\n\n" + image_str, "\n\n" + str(image_str_encode))
    # print(image, "\n\n" + image_str)
    # print(prompt, image, steps, ai_level, cn_mode)

    new_sdToImg = SdToImgCreate(
            type="txt2img",
            prompt=prompt,
            step=steps,
            cfg=ai_level,
            controlnet_mode=cn_mode,
            content=image,
            create_by=create_by,
            create_time=datetime.datetime.now().strftime("%Y-%m-%d %H:%M:%S")
    )
    # print(object_to_json(new_sdToImg))
    get_new_sdToImg = create_sdToImg(db=db, sdToImg=new_sdToImg)
    # print(object_to_json(get_new_sdToImg))
    new_sdToImg_id = get_new_sdToImg.id
    # print(new_sdToImg_id)

    # choose_node = 'https://stable_api.cloudtim.com'
    # choose_node = 'https://stable_2070_api.cloudtim.com'
    choose_node = get_available_nodes(node_type='sd_txt_to_img')
    print(choose_node)
    if choose_node == None:
        request.session["error"] = _("no_sufficient_nodes")
        return RedirectResponse('/stables', status_code=status.HTTP_302_FOUND)

    txt2ImgResult = generate_txtToImg_by_id.delay(choose_node, new_sdToImg_id)
    # txt2ImgResult = generate_txtToImg_by_params(prompt, image_str, steps, ai_level,cn_mode)
    # print(txt2ImgResult)
    uuid = txt2ImgResult.id
    # print(uuid)

    #create task record to mysql 更改任务状态为1 pending，等待开始
    # print("create task time --> ",datetime.datetime.now().strftime("%Y-%m-%d %H:%M:%S"))
    create_task(uuid, choose_node, 1, "txtToImg_cn", create_by)

    new_sdToImg = SdToImgModify(
        id=new_sdToImg_id,
        uri=uuid,
        update_time=datetime.datetime.now().strftime("%Y-%m-%d %H:%M:%S"),
    )
    modify_sdToImg(db, new_sdToImg)
    request.session["message"] = _("success_saved")

    response = RedirectResponse('/stables', status_code=status.HTTP_302_FOUND)
    return response

