@router.post("/{id}/modify")
async def edit_stable_by_id_post(request: Request,
        # id: str,
        img_id: str = Form(...),
        uri: str = Form(...),
        seed: str = Form(...),
        image_file: UploadFile = Form(...),
        db: Session = Depends(get_db)):
    content = await image_file.read()
    image = base64.b64encode(content)

    new_sdToImg = SdToImgModify(
        id=img_id,
        seed=seed,
        uri=uri,
        update_time=datetime.datetime.now().strftime("%Y-%m-%d %H:%M:%S"),
        content_new=image,
    )
    modify_sdToImg(db, new_sdToImg)
    request.session["message"] = _("success_saved")

    return RedirectResponse('/stables', status_code=status.HTTP_302_FOUND)


