@router.post("/{id}/download", response_class=HTMLResponse)
async def download_img(request: Request, id: str, db: Session = Depends(get_db)):
    # print(id)
    get_image = get_img_by_id(db, id)
    request_json = object_to_json(get_image)

    image_content = request_json.get('content_new')
    # print(image_content)
    image_seed = request_json.get('seed')
    img_name = datetime_to_timestamp() + '_' + str(image_seed) + '.jpg'

    basedir = os.path.abspath(os.path.dirname(__file__))
    rootPath = basedir[:basedir.find('cn_server')+len('cn_server')]
    image_path = os.path.join(rootPath, 'temp', img_name)

    with open(image_path, "wb") as f:
        f.write(base64.b64decode(image_content))
    return FileResponse(image_path, media_type='image/jpg', filename=img_name,background=BackgroundTask(lambda: os.remove(image_path)))

